import { useState } from "react"

const Tasks = () => {
    const [tasks, setTasks] = useState(
        [
            {
                id: 1,
                text: 'Dentist Appointment',
                day: 'May 19th at 3:00pm',
                reminder: true,
            },
            {
                id: 2,
                text: 'Attorney Appointment',
                day: 'May 20th at 2:00pm',
                reminder: true,
            },
            {
                id: 3,
                text: 'Psychiatirist Appointment',
                day: 'May 21st at 1:00pm',
                reminder: true,
            },
        ]
        
    )

  return (
    <>
        {tasks.map((task) => (
            <h3 key={task.id}>{task.text}</h3>

        ))}
    </>
  )
}

export default Tasks
